package bean;

public class friendVo {

	int rno;
	String fr_oid;
	String ph_sysfile;
	String fr_date;
	
	
	
	public friendVo() {
		// TODO Auto-generated constructor stub
	}



	public int getRno() {
		return rno;
	}



	public void setRno(int rno) {
		this.rno = rno;
	}



	public String getFr_oid() {
		return fr_oid;
	}



	public void setFr_oid(String fr_oid) {
		this.fr_oid = fr_oid;
	}



	public String getPh_sysfile() {
		return ph_sysfile;
	}



	public void setPh_sysfile(String ph_sysfile) {
		this.ph_sysfile = ph_sysfile;
	}



	public String getFr_date() {
		return fr_date;
	}



	public void setFr_date(String fr_date) {
		this.fr_date = fr_date;
	}
	
	
	
}
